met Jake Gyllenhaal, Reese Witherspoon en Meryl Streep

Als haar van terrorisme verdachte echtgenoot tijdens een vlucht van Zuid-Afrika naar Washington verdwijnt, besluit Isabella 
(Reese Witherspoon) de zaak met behulp van een politieke vriend verder uit te zoeken. In dezelfde tijd is CIA-agent Douglas 
Freeman (Jake Gyllenhaal) getuige van een nogal onorthodox verhoor, dat de nodige vragen bij hem naar boven brengt.
